import React from "react";
import  ReactDOM  from "react-dom";
import logo from './logo.svg'

function Image()
{
  <img src={logo} width = {200}/>;
}


const element = <>

  <Image/>
  <h1>Reasons Why i want to learn react!</h1>
  <ol>
    <li>I want ot learn it because it is awesome</li>
    <li>I want to build really cool stuff using it</li>
    <li>It has a really cool name</li>
    <small>Iqbal.limited</small>
  </ol>
</>






const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(element);
